          <div className="carousel-item active">
            <a
              href="https://www.wanted.co.kr/wd/22942">
              <img
                  src="https://s3.ap-northeast-2.amazonaws.com/static.wanted.co.kr/homework/001.jpg"
                  className="d-block w-100"
                  alt="..." />
            </a>
          </div>

        );
    }
}

